INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (7, 0.0, -363.0, "2030/12/17 14:59:59", 106001, "キャル", "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", "2015/12/17 15:00:00", 0.0, 0, 1, 0, 7001, 1, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (7, 0.0, -363.0, "2030/12/17 14:59:59", 105901, "コッコロ", "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", "2015/12/17 15:00:00", 0.0, 0, 1, 0, 7002, 1, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (7, 0.0, -363.0, "2030/12/17 14:59:59", 105801, "ペコリーヌ", "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", "2015/12/17 15:00:00", 0.0, 0, 1, 0, 7003, 1, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (10, 0.0, -363.0, "2030/12/17 14:59:59", 105801, "ペコリーヌ", "ジュエルを食べ物…\nいえ、貴重品と交換できます！", "2015/12/17 15:00:00", 0.0, 0, 1, 0, 10001, 1, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (10, 0.0, -363.0, "2030/12/17 14:59:59", 106001, "キャル", "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", "2015/12/17 15:00:00", 0.0, 0, 1, 0, 10002, 1, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (10, 0.0, -363.0, "2030/12/17 14:59:59", 105901, "コッコロ", "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", "2015/12/17 15:00:00", 0.0, 0, 1, 0, 10003, 1, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (10, 0.0, -363.0, "2030/12/17 14:59:59", 106401, "シェフィ", "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", "2015/12/17 15:00:00", 0.0, 0, 1, 2104010, 10004, 2, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (12, 0.0, -416.5, "2030/12/17 14:59:59", 105801, "ペコリーヌ", "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", "2015/12/17 15:00:00", 0.0, 0, 1, 0, 12001, 1, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (13, 0.0, -363.0, "2030/12/17 14:59:59", 106001, "キャル", "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", "2015/12/17 15:00:00", 0.0, 0, 1, 0, 13001, 1, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (13, 0.0, -363.0, "2030/12/17 14:59:59", 105901, "コッコロ", "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", "2015/12/17 15:00:00", 0.0, 0, 1, 0, 13002, 1, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (13, 0.0, -363.0, "2030/12/17 14:59:59", 106401, "シェフィ", "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", "2015/12/17 15:00:00", 0.0, 0, 1, 2104010, 13003, 2, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (13, 0.0, -363.0, "2030/12/17 14:59:59", 105801, "ペコリーヌ", "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", "2015/12/17 15:00:00", 0.0, 0, 1, 0, 13004, 1, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (14, 0.0, -363.0, "2030/12/17 14:59:59", 105901, "コッコロ", "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", "2015/12/17 15:00:00", 0.0, 0, 1, 0, 14001, 1, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (14, 0.0, -363.0, "2030/12/17 14:59:59", 106401, "シェフィ", "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", "2015/12/17 15:00:00", 0.0, 0, 1, 2104010, 14002, 2, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (14, 0.0, -363.0, "2030/12/17 14:59:59", 105801, "ペコリーヌ", "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", "2015/12/17 15:00:00", 0.0, 0, 1, 0, 14003, 1, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (14, 0.0, -363.0, "2030/12/17 14:59:59", 106001, "キャル", "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", "2015/12/17 15:00:00", 0.0, 0, 1, 0, 14004, 1, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (15, 0.0, -470.0, "2030/12/17 14:59:59", 105901, "コッコロ", "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", "2015/12/17 15:00:00", 0.0, 0, 1, 0, 15001, 1, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (16, 0.0, -363.0, "2030/12/17 14:59:59", 106401, "シェフィ", "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", "2015/12/17 15:00:00", 0.0, 0, 1, 2104010, 16001, 2, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (16, 0.0, -363.0, "2030/12/17 14:59:59", 105801, "ペコリーヌ", "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", "2015/12/17 15:00:00", 0.0, 0, 1, 0, 16002, 1, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (16, 0.0, -363.0, "2030/12/17 14:59:59", 106001, "キャル", "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", "2015/12/17 15:00:00", 0.0, 0, 1, 0, 16003, 1, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (16, 0.0, -363.0, "2030/12/17 14:59:59", 105901, "コッコロ", "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", "2015/12/17 15:00:00", 0.0, 0, 1, 0, 16004, 1, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (17, 0.0, -363.0, "2030/12/17 14:59:59", 105901, "コッコロ", " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", "2015/12/17 15:00:00", 0.0, 0, 1, 0, 17002, 1, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (25, 0.0, -363.0, "2030/12/17 14:59:59", 106001, "キャル", "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", "2015/12/17 15:00:00", 0.0, 0, 1, 0, 17004, 1, 1);
