INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (21, 0.0, -363.0, "2030/12/17 14:59:59", 106001, "キャル", "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", "2015/12/17 15:00:00", 0.0, 0, 1, 0, 21001, 1, 1);
