INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (22, 0.0, -430.0, "2030/12/17 14:59:59", 190801, "カリン", "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", "2015/12/17 15:00:00", 0.0, 0, 1, 0, 22001, 1, 1);
