INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (24, 8.0, -385.0, "2030/12/17 14:59:59", 109001, "エリコ（バレンタイン）", "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", "2019/01/31 12:00:00", 4.08, 10011, 2, 0, 24001, 1, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (24, 8.0, -385.0, "2030/12/17 14:59:59", 109001, "エリコ（バレンタイン）", "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", "2019/01/31 12:00:00", 5.0, 10011, 2, 0, 24002, 1, 2);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (24, 8.0, -385.0, "2030/12/17 14:59:59", 109001, "エリコ（バレンタイン）", "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", "2019/01/31 12:00:00", 10.11, 10011, 2, 0, 24003, 1, 3);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (24, 8.0, -385.0, "2030/12/17 14:59:59", 109001, "エリコ（バレンタイン）", "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", "2019/01/31 12:00:00", 4.0, 10011, 2, 0, 24004, 1, 4);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (24, 8.0, -385.0, "2030/12/17 14:59:59", 109001, "エリコ（バレンタイン）", "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", "2019/01/31 12:00:00", 6.0, 10011, 2, 0, 24005, 1, 5);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (24, 0.0, 0.0, "2030/12/17 14:59:59", 109002, "エリコ（バレンタイン）", "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", "2019/01/31 12:00:00", 0.0, 10011, 1, 0, 24006, 1, 6);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (24, 0.0, 0.0, "2030/12/17 14:59:59", 109002, "エリコ（バレンタイン）", "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", "2019/01/31 12:00:00", 0.0, 10011, 1, 0, 24007, 1, 7);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (24, 0.0, 0.0, "2030/12/17 14:59:59", 109002, "エリコ（バレンタイン）", "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", "2019/01/31 12:00:00", 0.0, 10011, 1, 0, 24008, 1, 8);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (24, 0.0, 0.0, "2030/12/17 14:59:59", 109002, "エリコ（バレンタイン）", "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", "2019/01/31 12:00:00", 0.0, 10011, 1, 0, 24009, 1, 9);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (24, 0.0, 0.0, "2030/12/17 14:59:59", 109002, "エリコ（バレンタイン）", "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", "2019/01/31 12:00:00", 0.0, 10011, 1, 0, 24010, 1, 10);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (24, 8.0, -385.0, "2030/12/17 14:59:59", 109101, "シズル（バレンタイン）", "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", "2019/01/31 12:00:00", 2.12, 10011, 2, 0, 24011, 1, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (24, 8.0, -385.0, "2030/12/17 14:59:59", 109101, "シズル（バレンタイン）", "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", "2019/01/31 12:00:00", 4.19, 10011, 2, 0, 24012, 5, 2);
