INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (24, 0.0, 0.0, "2030/12/17 14:59:59", 109102, "シズル（バレンタイン）", "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", "2019/01/31 12:00:00", 0.0, 10011, 1, 0, 24019, 1, 9);
